    data: |
      SELECT DISTINCT - col2 FROM tab1 (FORMAT parquet) WHERE NOT - 78 - - 71 * - - ( + 60 ) + + col0 + 16 / + 54 < + + 69 / - col0 * col2;
  - name: tab1

outputs:
  - name: q7853.out
    data: |
      -59
      -68
      -96
